    geo_json_5cd39c64cc4a696a933a1040f35081f1.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["Portiek", "Reparatiekosten_per_breukdeel", "Reparatiekosten_per_appartement", "Reparatie_aantal_per_appartement", "percentage_Ymere", "Reparatie_counts", "apartments_count"];

    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i].toLocaleString()}</th>
            
            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
